import React from "react";
import "./css/style.css";
import Navbar from "./components/Navbar";
import TopNews from "./components/TopNews";
class App extends React.Component{
    
    render(){
        return(
            <div className="main" >
                <div className="wrapper">
                    <Navbar/>
                    <TopNews/>
                </div>

            </div>
        );
    }
}
export default App;
